import React from 'react';
import styled, { createGlobalStyle } from 'styled-components';

const FullScreen = styled.div`
  height: 100vh;
  width: 100vw;
  background-color: grey;
`;

// const 
const MainLayout = ({ children }) => (
  <Global>
    <FullScreen>
      <h1>asdad</h1>
      {children}
    </FullScreen>
  </Global>
);

export default MainLayout;
